var title_f37_44_38596="Female pelvic lymphadenectomy";
var content_f37_44_38596=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F75242&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F75242&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 494px\">",
"   <div class=\"ttl\">",
"    Female pelvic lymphadenectomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 474px; height: 357px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Lymph node dissection is begun by sharply and bluntly mobilizing the tissue lateral to the external iliac artery and vein, and moving this tissue until the external iliac artery can be identified. The dissection should be kept close to the artery to facilitate the resection. Using Metzenbaum scissors and forceps, the lymphatic tissue is then sharply dissected off the surface of the external and common iliac arteries, and reflected medially. With lateral traction at this time, the external iliac vein and obturator fossa can be identified.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of William J Mann, Jr, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
