" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Modified Framingham clinical criteria for the diagnosis of heart failure",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Major",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Paroxysmal nocturnal dyspnea",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Orthopnea",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Elevated jugular venous pressure",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pulmonary rales",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Third heart sound",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cardiomegaly on chest x-ray",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pulmonary edema on chest x-ray",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       Weight loss &ge;4.5 kg in five days in response to treatment of presumed heart failure",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Minor",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Bilateral leg edema",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Nocturnal cough",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Dyspnea on ordinary exertion",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Hepatomegaly",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pleural effusion",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Tachycardia (heart rate &ge;120 beats/min)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Weight loss &ge;4.5 kg in five days",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Diagnosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       The diagnosis of heart failure requires that",
"       <strong>",
"        2 major or 1 major and 2 minor criteria",
"       </strong>",
"       cannot be attributed to another medical condition.",
"      </td>",
"     </tr>",
"    </table>",
