" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Acromioclavicular injury Type IV",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 289px; height: 515px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Type IV AC injuries are uncommon and involve forceful posterior displacement of the distal clavicle (arrow) from the acromion (arrow-head). The injury and posterior displacement are easier to see on this axillary view. The humoral head and glenoid are in normal anatomic position.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Scott M Koehler, MD.",
"    </div>",
"   </div>",
"  </div>",
